VERLEVERT\nDISIPLINLEDER\n************************************************************************\n*******************************************\n\n\n08.07.2018 Torleif Meek Aibel\n******************************************************************\nHar lagt til 6 vedlegg under "attachement list" som viser komplett\nstatus av fjerning av kabler på denne jobben. I tillegg er ett sett\nkopier lagt i original pakken som blir sendt på land 09.07.18 for\nAS-BUILT. I tillegg er det sendt mail til Aibel Enginering/OPC med\nkomplett status, slik at videre aksjoner kan bli tatt.\nJobbpakken sendes på land med helikopter 09.07.2018\n\n\n24 214418 Inst. av ventiler for kompressorturbin\n*************************************************\nPga utfall på hovedkraft fredag 06.04.18 kl 8.45 fikk vi ikke ut AT`r\nfør lørdag 07.08.18 kl 14.00 i deler av andre områder en her på P21 og\nC12. Så vi måtte omprioritere og jobbe på andre jobber.\n*************************************************************\nSå ikke behov for stillas. Da vi bruker sele og arbeid over sjø AT.\n09.04.2018 Morten Rolfsnes\n*************************************************\nJobbpakke mottatt offshore\nMye stillas som bortfaller da vi klatrer og bruker seler.\nForhåndsmelding purret på AI og FA-aut. Pga driftsproblemer med\nhovedkraft så ble det 1.pri for å ordnet.\n04.04.18 Morten Rolfsnes\n*************************************************\nAibel anviser samtlige stillaser offshore\nRune Aaland, PZL, 26.10.17\n**************************************************\n\nI følge med oppgradering av Turbinkontrollsystem, skal Aibel Assistere\nStatoil.\n\nDenne AO er multidisiplin og omhandler Aibels scope of work i RS2018\n\nFør RS skal noe stilas monteres. Dette stillaset skal brukes rett etter\nRS ifølge med fjerning av kabler mellom P21 og C12.\nI RS skal:\nFuelgass ventil UV-23-0317 byttes. Aibel kobler fra og fjerner kabler\nmellom ventil og boks IB-23-0049. Aibel bytter ventil, trekker og\nterminerer nye feltkabler fra IB-23-0307.\n- Dieselventil UV-23-0317: Aibel skal koble fra kabler mellom ventil og\nkoblingsboks IB-23-0050. GE skal bytte ventil (utføres i Statoil AO\n24122022). Aibel kobler til ventil med nye kabler mellom ventil og\nkoblingsboks IB-23-0317. Til denne ventilen skal GE også montere ny\nventil HZY-23-0317, denne føler på diesel supply og vil stenge UV-23-\n0317 dersom diesel tilførsel opphører. Aibel skal oppdatere P<(>&<)>ID\nved å\ninkludere HZY-23-0307.\n\nEtter RS skal koblingsboksene IB-23-0049 og IB-23-0050 demonteres og\nfjernes. (boksene skal leveres til Statoil ved Knut Nilsen for å\ndemontere elektronikk kort i SAP AO 24122022) Tilhørende kabler mellom\nboksene i P21 og kabinett i C12 skal kobles fra og fjernes. Det er\nplanlagt noe stilas i P12 og C12. Det er også planlagt noe tilkomst på\nkabeltrase over sjø.\nNår kabler er fjernet skal stilas demonteres.\n******************************************\n28.03.18 Henning Samdal, Aibel, 85269378\nAO sendt for utførelse offshore.\n******************************************\n','E','','','','','','163034','OR000024212278',NULL,'','','E','00000000','O053C',' ','','M.O053C.6I.S.0001.B5','M.O053C.6I.S.0001.B5','','','','TA1_18','Revisjonsstans OSS 2018','1766','P21','','PROCESS AREA MAIN DECK LEVEL 1','','1766','','0.000','C02AUT','AIBEL V&M AUTOMASJON','','','1766',' ',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
