Enerhaug:\nDet gjenstår å sjekke om det er innvendig korrosjon i rørlinje, like ved\nEV-ventil (EV 5522 18), ref detaljer i M3-45039718 (frå pigging) om\nmulig innvendig korrosjon med dybde 4,7 mm.\nDet skal derfor planlegges for NDT av mulig korrodert område, med\nutførelse i NDT-kampanje høst 2018.\nDet er god tilkomst for NDT i Z10.\nNår det gjelder utvendig tilstand er det verifisert at det ikke er noen\nsignifikante korrosjonsangrep, ref M3-45299648 fra visuell inspeksjon\nutført juni 2018.\n------------\n06.04.2018 Jakob Enerhaug:\nUtfør visuell kontroll av angitte områder. Dersom påvist materialtap\nikke kan knyttes til utvendig korrosjon skal det vurderes å utføre NDT.\nDiskutèr dette med Jakob etter utført visuell inspeksjon.\n\n\n<H>Bakgrunn:</>\nEtter inspeksjonspigging i AO-23267123 ble det rapportert om innvendig\nog utvendig korrosjon ved EV-ventil. For å finne omfanget er det behov\nfor avisolering for visuell inspeksjon og for å vurdere behov for NDT.\n\n<H>Tnom:</>\n<H>Medie:</>\n<H>Skademekanisme: </>CO2-korrosjon innvendig / CUI utvendig\n\n\n\n<H>Inspeksjonsomfang:</>\nVisuell inspeksjon av ZWI-18-0010\n\n<U>Vurdere om det er behov for avisolering og evt. velge ut punkt for\ndette.</>\n<U>Ønsker at det kommenteres tilkomst og timer for av- / reisolering for\n inspeksjon vha. PA i en senere kampanje. </>\n\n\n\n<H>Historikk:</>\nRapportert om tre utv/innv. korrosjon topside piping ved\ninspeksjonspigging. Distanse 55-56m, rett før EV på henholdsvis 3,2mm, 4\n,7mm og 4,2mm også rapportert om utvendig materialtap på 2mm tre steder i samme\nområde.\nRef. M3-45039712\n\n\n<H>Vedlegg:</>\nInspeksjonsunderlag\nSjekklister\n\n<H>Planlagt av:</>\n11.06.18 / Eli Beate Mjelde Stokken','E','','','','','','','OR000024367518',NULL,'','','E','10007454','O053C','U','Unprior <= 12 months','T.O053C.GA.S1020','T.O053C.GA.S1020','','45110858','','','','1766','','','','','1766','1766-0200-ZWI-18-0010-KA7-03-A','46000.000','PPMISP','PV Inspeksjon statisk prosessutstyr','','','1766','U',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
