05.2017: Her må AI v/Kjetil Helvik finne en erstatningsventil med\nbedre kvalitet enn savero. //Jonny\n________________________________________________________________________\n\n14/8-17: Feilaktig lagt mot PS02_17, og flyttes til RS2018 da jobben\nikke er besluttet gjennomført enda + vi må sikkert forvente minimum 6\nmnd leveringstid. KTSTO\n________________________________________________________________________\n\n31.10.17: Har oppretta M5 45027959 for å få oppretta materialnummer på\nny type DB<(>&<)>B-ventil frå FG valvole. Denne óg er italiensk og det\ner framleis Ellingsen som er leverandør. Legg ved teikninga me har fått\nfrå Ellingsen. Der viser det at bleed-ventilen er festa på ein heilt\nanna måte enn i Zavero, og slik sett er eg (og Kåre) trygg på at desse\nventilane har færre lekkasjepunkt. // Per B.\n________________________________________________________________________\n\n02.11.17: Har fått oppretta materialnummer no. Dette er knytt til TAG,\nog eg har rekvirert 4 stk nye ventilar + dokument til desse. Lagt inn\noperasjonar og estimert timar. Estimert kost ut frå at me skulle få\nventilane noko billegare enn det originale tilbodet frå Ellingsen. AO er\nklar for release, og det må skje fort, ellers får me ikkje ventilane i\ntide... // Per B.\n________________________________________________________________________\n\n07.06.18: Oppretta M5 45284699 for å få lagerført reserveventilen på\nMongstad. // Per B.\n________________________________________________________________________\n\n090618. Ubrukt DBB returneres til base stock på RD 500855543//ØM','E','','','','','','162410','OR000024089636',NULL,'','','E','10007454','O053C','L','Low <= 6 months','T.O053C.GA.S1001','T.O053C.GA.S1001','','44840202','','TA1_18','Revisjonsstans OSS 2018','1766','P00','','PROCESS AREA GENERAL','','1766','1766-WS-23-0820','900000.000','POMMEC','DV Mekanisk','','','1766','S','Y',' ',' ','E','E','40','Shutdown WO','TA1_18',NULL,'Y',NULL,' ',' ',' ','4','3',' ','');
