8:\n1 bekreftet gass - overtrykk - Ingen aksjon\n2 bekreftet gass - overtrykk - Ingen EL.trip 2\n1 bekreftet gass - LL på overtrykk - Ingen aksjon\n2 bekreftet gass - LL på overtrykk - EL.trip 2\n\nAlt av strøm ble kuttet ut i D40. Vi hadde lagt det ene vifte settet på\nnødstrøm og det andre på vanlig strøm.\nVed EL.trp 2 går strømmen til tavlene for styring av vifter ut. Dermed\ndetter alt av vifter ut. Dette må bygges om. Avtreksvifter for shaker\nstopper. denne må det legges opp parmanent mating fra nødstrøm. Inn med\nen ny EXD kapsling i skap og en styringsenhet for denne.\nVed bekrefted gass må aldri avsugsviften på shaker stoppe. Det medfører\nen forverring av hendelsen.\nDet bør bli en ny vurdering av filosofien på lir/ler i D40. Ingen gass i\nluftinntaket, ikke LL på flow inn til lir/ler, må ikke strømmen legges\nut. Lir/Ler har mange varme komponenter, slik at det å kutte ut strømmen\ni disse rom øker risikoen for en hendelse.\nI styreprogrammet ligger det inne en spylesekvens, problemet med denne\ner at vi må ha viftene i gang for å ha glede av denne.\n\nDet virker som om logikken er laget for ett anlegg som har separat\ntilførsel av luft (hvac).  Jan Breili\n\nTilleggskommentar fra Ernst.\n\nVidere ble det avdekket følgende svakheter som bør vurderes.\n1.,,EM-77-5280 «Loggekontor tilluftsvifte» er matet fra EN-82-0003, ved\nbortfall av hovedkraft vil Loggekontor(Overtrykksrom D42) ligge med tap\nav overtykk. Vifte bør dobles med en fra 84 system.\n2.,,EM-77-5285 «Shakerrom avtrekksvifte» er også kun matet fra\nEN-82-0003, ved bortfall av hovedkraft vil denne vifte stoppe. Denne\nvifte er en tillegsvifte for shaker avtrekk, som er bygget inn i system\nsenere i tid. Uheldigvis er det i denne kanal vi har gassdeteksjon. Nye\npaneler  IA-70-0001 /0002 - (AZ-704201DAA/1DBA). Vifte bør dobles med en\nfra 84 system.\n\nErnst Kolstø\n\n\n\n20.09.2018\nMorten Sætre\nOppdatert/siste versjon av testprosedyre:\n\nNot laget basert på M6: 43726088 - Sjekke ut logikk for Eltrip 2\nshakerrom\n\nUtføre enkel test for å verifisere at nedstenging er ihht. ASC 11-3A-AK-\nF79-00001.\n\nDet antas å være tilstrekkelig å utføre test på en av de fem\ntransmittere (PDT) for romovervåking. Dersom avvik fra ASC avdekkes, må\nalle transmittere testes. Avvik på tidsforsinkelse er allerede kjent.\n\nForutsetninger:\nEn må sikre at samtlige fem transmittere ligger over LL-grense i forkant\nav testing. Relevant KCAD-personell bør være tilstede under testingen.\n\nI forkant og parallelt med test skal trykkmålinger (DP-målinger) for de\nfem berørte rom i D40, observeres:\n- D44-0505, Upper Drill Floor Switchroom (PDT-77-5105).\n- D43-0303, Drill Floor Logging Office (PDT-77-5104).\n- D43-0404, Drill Floor Switchroom (PDT-77-5103).\n- D42-0808, Transformer Room, Mezzanine Deck (PDT-77-5102).\n- D42-0303, Mud Logging room, Mezzanine Deck (PDT-77-5101).\n\nTestoppsett:\nFør testgass påføres detektorene, skal LL-alarm fra PDT blokkeres, dette\nfor å verifisere at ikke gassdeteksjon alene gir el.trip 2.\n\n- PA-alarmene, US-70-1006/7/8/9, blokkeres\n- Kranførere og Boring informeres om test\n- Start av brannpumpe, NTA -71-1143 og NTA -71-1243, blokkeres fra HMI\n- El.trip 1 blokkeres på HS  -70-5001\n- El.trip 2 blokkeres på HS  -70-0202K fra matrise (nede helt til\nvenstre på matrisen). I tilfelle samtidig\n  tap av overtrykk blokkeres LL på PDT -77-5101/5102/5103/5104/5105\n- HZV -50-0062 blokkeres\n\nTrykkmålingen skal dokumenteres ved hjelp av trend med 1 sekund\noppløsning (Prograf CFC online trend, og/eller HMI egendefinert trend).\n\na) med trykk over LL-grense (> 25 Pa)\nb) deretter med trykk under LL-grense (< 25 Pa)\nc) med trykk over øvre målegrense på transmitter\n\nVed test benyttes oppmerket ASC rev.64L for D4201.\n\nFør testgass påføres detektorene gjøres følgende:\n\n\n\n1. Deteksjon singel gass på områdegassdetektorene AR-70-4201DBA og -DAB\n<(>,<)>\ni shale shakerrom.\n\n2. Deteksjon bekreftet gass på områdegassdetektorene AR-70-4201DBA og -\nDAB, i shale shakerrom. For å aktivere Eltrip2 oppheves blokkering av LL\npå aktuell PDT og deretter blokkering av Eltrip2 på matrise.\n\nAvhengig av utfallet av testingen, vil videre aksjoner og tiltak bli\nvurdert.\n**********************\n19.09.2018, Jarle Gulbrandsen\nTestprosedyre oppdatert med detaljinfo om signaler som skal blokkeres\nfør test, iht. test av gass i D4201 utført 12.09 (PM06 24529521).\n\n17.08.2018\nMorten Sætre, Torstein Moen, Jarle Gulbrandsen og Espen Heggland Lien.\nRevidering av testprosedyre, ref. møte 16.08.2018 (møtereferat vedlagt:\n"RE Overtrykk i D40 EL trip 2 OSS").\n\nBeskrivelse av redusert funksjon eller feiltilstand:\n\nNot laget basert på M6: 43726088 - Sjekke ut logikk for Eltrip 2\nshakerrom\n\nUtføre enkel test for å verifisere at nedstenging er ihht. ASC 11-3A-AK-\nF79-00001.\n\nDet antas å være tilstrekkelig å utføre test på en av de fem\ntransmittere (PDT) for romovervåking. Dersom avvik fra ASC avdekkes, må\nalle transmittere testes. Avvik på tidsforsinkelse er allerede kjent.\n\nForutsetninger:\nDet forutsettes at punkt III. i vedlagt møtereferat er utført; "Sjekke\nrange og effekt av «peak» på transmittere PDT -77-5101, PDT -77-5102,\nPDT -77-5103, PDT -77-5104 og PDT -77-5105; Gir «peak» 0-signal, altså i\npraksis bortfall av overtrykk?"\n\nEn må sikre at samtlige fem transmittere ligger over LL-grense i forkant\nav testing.\n\nI forkant og parallelt med test skal trykkmålinger (DP-målinger) for de\nfem berørte rom i D40, observeres:\n- D44-0505, Upper Drill Floor Switchroom (PDT-77-5105).\n- D43-0303, Drill Floor Logging Office (PDT-77-5104).\n- D43-0404, Drill Floor Switchroom (PDT-77-5103).\n- D42-0808, Transformer Room, Mezzanine Deck (PDT-77-5102).\n- D42-0303, Mud Logging room, Mezzanine Deck (PDT-77-5101).\n\nTestoppsett:\nFør testgass påføres detektorene, skal LL-alarm fra PDT blokkeres, dette\nfor å verifisere at ikke gassdeteksjon alene gir el.trip 2.\n\nTrykkmålingen skal dokumenteres ved hjelp av trend med 1 sekund\noppløsning (Prograf CFC online trend, og/eller HMI egendefinert trend).\n\na) med trykk over LL-grense (> 25 Pa)\nb) deretter med trykk under LL-grense (< 25 Pa)\nc) med trykk over øvre målegrense på transmitter\n\nVed test benyttes oppmerket ASC rev.64L for D4201.\n\nFør testgass påføres detektorene gjøres følgende:\n- PA-alarmene, US-70-1006/7/8/9, blokkeres\n- Kranførere og Boring informeres om test\n- Start av brannpumpe, NTA -71-1143 og NTA -71-1243, blokkeres fra HMI\n- El.trip 1 blokkeres på HS  -70-5001\n- El.trip 2 blokkeres på HS  -70-0202K fra matrise (nede helt til\nvenstre på matrisen). I tilfelle samtidig\n  tap av overtrykk blokkeres LL på PDT -77-5101/5102/5103/5104/5105\n- HZV -50-0062 blokkeres\n\n\n1. Deteksjon singel gass på områdegassdetektorene AR-70-4201DBA og -DAB\n<(>,<)>\ni shale shakerrom.\n\n2. Deteksjon bekreftet gass på områdegassdetektorene AR-70-4201DBA og -\nDAB, i shale shakerrom. For å aktivere Eltrip2 oppheves blokkering av LL\npå aktuell PDT og deretter blokkering av Eltrip2 på matrise.\n\nAvhengig av utfallet av testingen, vil videre aksjoner og tiltak bli\nvurdert.\n\n*******************************************************\n080818: Vi har flowmålinger i innløpskanalen til hvac. Denne bekrefter\nda at viften går og at det kommer luft inn i rommet. Gjelder alle rom.\nLegge inn ny logikk i discos:\nikke flow & ikke overtrykk  ( forsinkelse) + bekrefted gass = El.trip 2.\n\nOvertrykket i hvac rom i borring er ustabile, ingen har luftsluse ved\ndør. Som hadde gitt ett bedre og stabilere overtrykk i rommene, men\ningen garanti, for vindstyrke og retning gir ustabilt trykk i rommene.\nSe vedlegg. Logikk sier at hvis vi har bekrefted gass i ett av områdene\nfår vi El.trip 2 uten forsinkelse. Hvis en går inn i ett av rommene med\novertrykk samtidig, da har vi El trip 2. Legger med vedlegg på endring i\nnode, kan legge inn en "& port" slik at ALL på Flow og PLL på trykk i\nrommet gir en forsinkelse på El trip 2.   Jan Breili\n\n\n240618: Sendt mail til Andreas. Overtrykket i alle hvac rom i D40 er\nveldig ustabil. Se vedlegg\nDet må først få ett stabilt HVAC regulering av overtrykksrom i D40 før\nvi går videre. Alle rom er nærliggende shaker rommet, ett av hvac\nrommene med lavt trykk og du har EL trip 2 med bekrefted gass.\nLegger jobben i sop for behandling i AI med Sætre som ansvarlig\nfor fremdriften av denne AO. Jan Breili\n\n\n12.12.2017\nMorten Sætre\nTenisk fag-/systemansvarlig HVAC Oseberg\n\nEnig i kommentar fra Torstein Moen; jeg oppsummerer testomfanget under:\n\nBeskrivelse av redusert funksjon eller feiltilstand:\n\nNot laget basert på M6: 43726088 - Sjekke ut logikk for Eltripp 2\nshakerrom\n\nUtføre enkel test for å verifisere at nedstenging er ihht. ASC 11-3A-AK-\nF79-00001.\n\na) først med normert trykk og deretter\nb) med trykk over normert\n\n1. Deteksjon singel gass på områdegassdetektorene AR-70-4201DBA og -DAB\n<(>,<)>\ni shale shakerrom.\n\n2. Deteksjon bekreftet gass på områdegassdetektorene AR-70-4201DBA og -\nDAB, i shale shakerrom.\n\n\nI forkant og parallelt med test skal trykkmålinger (DP-målinger) for de\nfem berørte rom i D40, observeres:\n- D44-0505, Upper Drill Floor Switchroom (PDT-77-5105).\n- D43-0303, Drill Floor Logging Office (PDT-77-5104).\n- D43-0404, Drill Floor Switchroom (PDT-77-5103).\n- D42-0808, Transformer Room, Mezzanine Deck (PDT-77-5102).\n- D42-0303, Mud Logging room, Mezzanine Deck (PDT-77-5101).\n\n\nAvhengig av utfallet av testingen, vil videre aksjoner og tiltak bli\nvurdert.\n','E','','','','','','','OR000024289622',NULL,'','','E','10007454','O053C','U','Unprior <= 12 months','T.O053C.GA.S1001','T.O053C.GA.S1001','','45022237','','PS01_18','Planlagt stans nr 1 2018','1766','D40','','DRILLING AREA MODULE','','1766','1766-AR  -70-4201DBA','1.000','POMAUT','D&V Automasjon','','','1766','X',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
