er ut mot kjeden, men skal\nvære inn mot senter av kjedehjulet.  I tillegg er kjedelåsene monter med\ndreieretningen, så de må også snues slik at de er mot dreieretningen. Er\ndere i stuss så ta av på A siden og se hvordan de er montert der. Vi har\nsnudd låsene på MPB på begge sider, så alle kjedelåsene på alle tre\npumpene skal bli lik MPB.\nTor Ove Rød\n','E','','','','','','','OR000024566749',NULL,'','','E','10007448','O053C','U','Unprior <= 12 months','T.O053C.GA.S1004','T.O053C.GA.S1004','','45427885','','','','1766','D21','','MUD MODULE AREA LEVEL 1','','1766','1766-PB-11-5019B','0.000','C51MEC','B&B Mekanisk','','','1766','U',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
