n16.02.18/Geir Arne\nMålepunkter JUS-90-0001 og JUS-90-0002 er i KCA Delelager D22. JUS-90-\n0015 er i LIR D23.\n\n19.02.18/Geir Arne\nI enden av kabel JUS900015 i overgang JUS-90-0015 til leaky feeder\nJUS900004-W01 målte vi 0,4W og ingen reflektert effekt. Klarte ikke å\nmåle noe effekt ut på JUS-90-0002 (dvs ingen effekt ut på leaky feeder\nJUS900006-W01 i D22). På tappepunkt JUS-90-0001 målte vi 0,1W ingen\nreflektert effekt, dvs det er effekt ut på leaky feeder JUS900007-W01\nmen mye mindre enn det som kommer på kabelen i utgangspunktet. Tappe\npunktene er av typen Andrew Radiax 241235-1. Antar at tappepunktene er\nårsaken til de dårlige målingene i utgangspunktet (FV målinger ut fra\nbasestasjon). Må avklare hva vi gjør videre.\n************************************************************************\n25.03.2018 Roar Egeli\n\nEtter av å ha lest tekst ovenfor, så kunne det tyde på problem med en\nTAP OFF i D22, KCA Delelager. Men, iht. notifikasjon, så var det målt\nhøy reflektert verdi på JUS900015-W01 fra UHF kabinett, noe som jeg ikke\nfikk denne gang når jeg målte. Dette kan kanskje tyde på fukt i koaks\ntidligere og så har det tørket, men denne kabel ligger for det meste\ninnendørs og på kabelgater utendørs høyt over tak.\n\nFølgende er målt med Sitemaster:\n\n- JUS900015-W01, fra UHF rack og ut på spredenett kabel.\n  DTF-VSWR måling viser 1.19 (0.8%) reflektert på ca. 38m. Lengde 112m.\n\n- JUS-90-0001, DTF-VSWR måling fra KCA Delelager viser godt under 1%\n  reflektert på hele kabelen.\n\n- JUS-90-0002, DTF-VSWR måling fra KCA Delelager viser godt under 1%\n  reflektert på hele kabelen.\n\nDisse TAP OFFer er det ikke mulig å måle coax som kommer inn eller går\nut, da de er "skrudd" inn på hovedkabelen som et T-Ledd på en måte.\nEn DTF-VSWR måling inn på begge TAP OFFer på TAP connector viser 4.2 i\nVSWR (Over 36% reflektert). Dette høres unormalt høyt ut når dagens TAP\nOFFer er på 1.5 (4%) i VSWR normalt. Av tidligere erfaring, så kan\npassive splittere/combinere komponenter feile etter en hvis alder, 15 år\n++.\n\nMin anbefaling videre er å bytte ut begge disse to til HUBER+SUHNER sin\nTAP off type (Se vedlegg) eller tilsvarende og sette på connectorer på\nkabelen. Kabel er av typen Andrew Heliax LDF4RN-50A og plugg som passer\ner Huber+Suhner 11_N-50-12-50/033.\n\nDet har ikke vært rapportert problemer med UHF på D22/D23 området denne\nuken jeg har vært ombord.\n************************************************************************\n\n14.04.2018 Geir Arne Mauland\nLagt inn bestilling på nye tappepunkt + connectorer\n','E','','','','','','','OR000023939787',NULL,'','','E','10007454','O053C','U','Unprior <= 12 months','T.O053C.GA.S1049','T.O053C.GA.S1049','','44674721','','','','1766','C12','','UTILITIES AREA CELLAR DECK LEVEL 2','','1766','1766-JU-90-0001','30000.000','IMOTEL','FFO Tele','','','1766','U',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
