ilt deler. TD 22.05.17\n\n13.04.2018 Har lagt inn bestilling på ny videokabel til Slave Junction\nBox.\n\n17.02.2018 Har byttet kort i Slave Junction Box. Klarte ikke å oppdrive\norginal videosignal kabel så videosignal er fortsatt koblet direkte\n(utenom junction box). Lager en operasjon på å framskaffe kabel og koble\nom. Evt bestemme om vi skal fjerne hele Slave Junction Boxen da vi ikke\ntrenger den lengre. (Bridge Master er fjernet)\n\n24.01.2018 Motatt og lagt i Telecom LQ6 //T.S\n\n29.4.2017 Vurdere prioritet på denne AO // Kåre Molvik','E','','','','','','','OR000024058912',NULL,'','','E','10007454','O053C','U','Unprior <= 12 months','T.O053C.GA.S1049','T.O053C.GA.S1049','','44810059','','','','1766','C12','','UTILITIES AREA CELLAR DECK LEVEL 2','','1766','1766-JR-94-0001','20000.000','IMOTEL','FFO Tele','','','1766','U',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
insert into [dbo].[WorkOrder]([Abckz], [Artpr], [Aedat], [AbckzTxt], [Abnum], [Aenam], [Aezeit], [Akknz], [Arbpl], [Auart], [AuartTxt], [Aufnr], [Aufnt], [Aufpl], [Aufpt], [Autyp], [Beber], [BeberTxt], [Bukrs], [ClassificationPlant], [ControlClass], [CritContainment], [CritContainmentCategory], [CritCost], [CritCriticality], [CritFailHse], [CritMainFunction], [CritProduction], [CritRedundancy], [CritSafety], [CritSubFunction], [Eqfnr], [Equnr], [Erdat], [Erfzeit], [Ernam], [Gaueh], [Gauzt], [Gewrk], [Gltri], [Gltrp], [Gsber], [Gstri], [Gstrp], [Idat2], [Idat3], [Ilart], [IlartTxt], [Ingpr], [IngprTxt], [Iphas], [Iwerk], [IwerkTxt], [Kokrs], [Kostv], [Ktext], [Laufn], [Loekz], [Longtext], [Ltext], [McConceptNoConcern], [McConceptNoPlant], [McCriticalSpares], [McRepairStrategy], [McSparePartRequirement], [Msgrp], [Objnr], [Obknr], [Plnal], [Plnnr], [Plnty], [Ppsid], [Prctr], [Priok], [PriokTxt], [Proid], [Pspel], [Pverw], [Qmnum], [Refnr], [Revnr], [RevnrTxt], [Sowrk], [Stort], [StortAufk], [StortTxt], [Strno], [Swerk], [Tplnr], [User4], [Vaplz], [VaplzTxt], [Wapos], [Warpl], [Werks], [Zzfailimpind], [Zzwsc1], [Zzwsc10], [Zzwsc11], [Zzwsc12], [Zzwsc13], [Zzwsc14], [Zzwsc15], [Zzwsc16], [Zzwsc17], [Zzwsc2], [Zzwsc3], [Zzwsc4], [Zzwsc5], [Zzwsc6], [Zzwsc7], [Zzwsc8], [Zzwsc9], [Zzwscnr]) values('3','PM','2018-10-04 22:55:15.0000000','Crit.=H & Red.=A',NULL,'221656','PT22H55M15S','3','POMMEC','PM01','Corrective Maintenance Order','24087842','','1004603690','0000000000','30','23','GASSKOMPRESJON','1000','','','EH','','L','H','','1766-2302','H','A','L','1766-2302CONTROL_520_01','S2301','','2017-05-26 09:41:27.0000000','PT09H41M27S','416478','','0','10007513',NULL,'2018-10-06 00:00:00.0000000','','2017-09-24 00:00:00.0000000','2018-10-04 00:00:00.0000000','2018-10-04 00:00:00.0000000',NULL,'017','Expected Corrective Maint.','POM','Plattform D&V','3','1766','Oseberg Sør platform','1000','PLANOWES','Bytte PV-23-0685 på tetningsgass 3.tr.','',NULL,'Bytte PV-23-0685 på tetningsgass 3.tr.\n\nBytte eller overhale ventil, ettersom hva som er mest fornuftig utfra\nhistorikken til denne ventilen.\n________________________________________________________________________\n\n06.09.17: Denne gangen bør pakkboks/stem smøres inn med Clyde seal\n<(>,<)>\ntype 911. Ligger i skap C12.\n\nDet jobbes forøvrig med å skaffe ny komplett ventil (VariPak valve GE\nMasoneilan ) - Eventuelt vuredere erstatnings pakkboks.\n________________________________________________________________________\n\n20.10.17: Må ta med/pakke om plugg i ventilhus også! (Se svettelogg)\nDen hadde Not 44644967 med WO 23913883 som ble kansellert fordi den ble\nivaretatt av en annen WO; 23828622- som er satt i TECO RDOP. Men det er\nvisstnok fortsatt lekkasje her (termografi viser lekkasje)//Knut S.\n________________________________________________________________________\n\n22.10.17: Materiell blir ikke levert i tide til PS02_17. Utført ny\ngassmåling mtp lekkasje fra pakkboksen i vindstille vær. Ingen utslag\n10cm fra pakkboks som er kravet til å registrere diffus lekkasje.\nFlyttes derfor til RS 2018. //Jan\n________________________________________________________________________\n\n23.10.17: Materiellet vil ikke bli levert i tide for å rekke\nkompstoppen. Ny gassmåling tatt på denne mhp.  lekkasje fra pakkboksen i\nvindstille vær. Vi måler ingen utslag 10cm fra pakkboks som er kravet\ntil å registrere diffus lekkasje. Vi får utslag når vi stikker måler\nheilt inn i pakkboks,men det er ikke meir en ein kan forvente. Eg og\nFinn er forent med at vi lever godt med den lille lekkasjen her til\nvårens RS 2018. // Jan ingebrigtsen\n________________________________________________________________________\n\n24.10.17: Gitt historikken til denne ventilen, så rekvirerer eg ein ny,\nkomplett ventil, ref. tilbod frå Håland Instrumentering AS (vedlagt\nrekvisisjon). Har sletta dei andre postane, sidan det ikkje let seg\ngjere å skaffe ny stem til desse ventilane, ref. M6 not. 44970778. //\nPer B.\n________________________________________________________________________\n\n03.05.18: Ny ventil vert ikkje levert i tide til RS 2018. Legg AO til\nSTANS, så får me ta han att i komp.stopp til høsten. //Per B.\n________________________________________________________________________\n\n28.05.18: Sidan denne har ein stygg historikk med diffuse gasslekkasjar,\nså har me beslutta å ta ventilen ut av lina og pakke om pakkboksen no i\nRS''en. Har lagt inn operasjonar for å ivareta dette, i tillegg til\noperasjonar for å ivareta bytte av ventilen i kompressorstoppen til\nhausten. Veit ikkje når denne kjem, så eg la inn dato 01.09.18 på å lage\nrevidert V<(>&<)>B-liste, og så er den knytt med 45 dagar offset til\nneste operasjon (sette V<(>&<)>B-liste). Revisjonskoden på denne jobben\nmå endrast til STANS eller riktig kode for komp.stopp haust 2018 etter\nat alle operasjonane relatert til RS er ferdigstilt. // Per B.\n________________________________________________________________________\n\n07.06.18: Ny ventil skal verte levert frå fabrikk 05.07.18, ref. mail\nfrå Tom Steen. // Per B.\n________________________________________________________________________\n\n30.08.2018\nSer ut til at ny ventil er tilsvarende legges i pri_2 hylle mekanisk.\n\nSvenn Idar Nedberge\n________________________________________________________________________','E','','','','','','162410','OR000024087842',NULL,'','','E','10007454','O053C','U','Unprior <= 12 months','T.O053C.GA.S1001','T.O053C.GA.S1001','','44841098','','PRI_2','Samling av jobber uforutsett STANS PRI 2','1766','P21','','PROCESS AREA MAIN DECK LEVEL 1','','1766','1766-PV  -23-0685','35000.000','POMMEC','DV Mekanisk','','','1766','U','Y',' ',' ',' ','E','40','Shutdown WO','TA1_18',NULL,'Y',NULL,' ',' ',' ',' ','3',' ','');
