å detta att og slik det står montert i dag blir definert som\n"Mixed service" av produsent. Detta er nok rektig då me fekk ein\nreduksjon i temp på HKA etter platekjølerbytte. CA 10 grader.\nTCV som er montert i dag har ein set. temp på 66 grader, på\nkompressorturbin har me montert TCV med set. 60grader og her er\ntempraturen fin. Legg ny TCV med set. 60 grader i bestilling for å teste\ndette på HKA.\n\n***********************************************\nChristian Erstad, 7/3-2018\nTilbakemelding fra offshore (FA MEK, Aasmund) er at man mistenker feil\npå smøreoljeskid i felt som gjør at smøreoljen ikke går gjennom kjøler\npå vei tilbake til tank. Hvis dette stemmer så må det bygges om på\nsmøreoljeskid for å få dette riktig, og dette begynner å haste.\nSmøreoljetemperatur inn på turbinen var i februar over 80 grader, dette\ner altfor høyt. Anbefaler at det prioriteres å gjøre en oppgang i felt\nog tegnes inn på P<(>&<)>ID for å bekrefte eventuell feil, og deretter\nplanlegge for ombygging. I notifikasjon ligger kun noen GA tegninger med\ninntegnet varme/kalde rør, men slik jeg ser det gir ikke dette en\ntydelig indikasjon på hvor feilen ligger.\n*****************************************************\n160318. Byttet platepakke som var en trang affære mht tilkomst.\nResultatet var så ymse, ned til ca 70 grader ut av kjøler så har hjulpet\nlitt. RD 500841683 på retur av platepakke///ØM\n________________________________________________________________________\n10.10.18: Har monter inn ny ventilen med lavere temp\ntemperaturen før bytte var 69,9 etter bytte er temperaturen 66,9.\n\nSvenn Idar Nedberge','E','','','','','','','OR000024290167',NULL,'','','E','10007454','O053C','M','Medium <= 45 days','T.O053C.GA.S1001','T.O053C.GA.S1001','','45060545','','HKASTOPP','Samling av jobber mot Hka stopp','1766','C22','','UTILITIES AREA LEVEL 2','','1766','1766-TCV -80-1328','22100.000','POMMEC','DV Mekanisk','','','1766','S',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' 