n\n31.07.18 // MRRøttingen\nHar bestilt ny nippel etter avklaring med leverandør.\nSe vedlegg for mail.\n\n23.02.18: Det viser seg at me manglar kabelen som går frå koplingsboksen\ntil jordfeilmonitoren. Mest sannsynleg sendt med monitoren og ikkje\nreturnert att. Monitoren har ex d kapsling, me treng difor ein ny exd\nnippel. Av deet me greier å finne ut må den nye nippelen ha 3/4"\nNPT-gjenger. Kabelen som skal gjennom nippelen er ein BFOU 2x4, denne\nhar diameter 16mm. Legg ved bilete av dei to merkeskilta på kapslinga\ntil jordfeilmonitoren, samt bilete av nippelen som står i kapslinga på\n1.& 2.trinnet. Det må bestillast inn riktig nippel. Kabel har me så det\ntreng ikkje bestillast. Kapslinga vert lagt på smådellager att inntil\nvidare. S.Myrvang/ OASolheim\n\n13.03.2018 // DLE\nJordfeil monitor plassert på smådelelager C21 - Hylle 2\n\n27.02.2018 // MRR\nHar etterspurt innkjøper hva status er på denne.\n\n18.05.17\nDenne jordfeil monitoren er sendt til reparasjon hos leverandør (USA)\nmen Incontrol får ikke svar på om det er mulighet for å reparere denne.\nErstatning er ikke lengre godkjent for å stå i Sone 2. Hvis Incontrol\nskal lage en ny monitor (Som er godkjent Sone 2) vil denne koste rundt\n180.000kr og ha større fysisk størrelse.\nLøsningen er at vi har direktekoblet jordingen til jordbørsten og byttet\ndenne hver 6mnd i kompressorstoppen. Kanalen som børsten ligger i har\nvisning på om den er slitt eller ikke.\nMener dette er en fullgod løsning som ivaretar jordingen på en minst\nlike god måte som en monitor.\nForeslår at vi legger inn en 6mnd operasjon i FV malen for kompressoren\nog at det bestilles inn 2 stk jordbørste vi bytter ved stans. Både for\n1/2 trinnet og 3 trinnet.\nJobben legges i SPI for videre vurderingJAH\n\n20.06.16: Har demontert hele boksen og sendt den til leverandør for\nreparasjon. Legger jobben til land for oppfølging av jobb og planlegging\ni tid.//AMG\n\n26.05.16\nDet er mulig og koble fra boksen slik at vi kan få sendt den inn til\nIncontrol.\nSondre M har sjekket i felt.\nLeveringsadresse:\nIncontrol AS\nKokstaddalen 4\n5863 Bergen\nTorgeir Søbstad\nService ENG\nIncontrol AS\n0047 95151703\nJAH\n\n09.05.16\nEr i kontakt med incontrol, de har innmaten til bryteren og kan reparere\nboksen vi har ute, men da må den sendes inn.\nEr dette mulig?\nJAH\n\n20/02-2016:\nDet er kun venderen som er dårlig/defekt, hvis mulig må KUN denne\nbestilles (se vedlegg).\n\nLegges til land for oppfølging/planlegging. //OAS','E','71080-','','','','','','OR000023646382',NULL,'','','E','10007454','O053C','M','Medium <= 45 days','T.O053C.GA.S1001','T.O053C.GA.S1001','','44334419','','','','1766','P21','','PROCESS AREA MAIN DECK LEVEL 1','','1766','1766-EC-23-0005','7000.000','POMELE','D&V Elektro','','','1766','S',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
