er ute for\nkompletering av F17\nCameron stiller med nødvendig utstyr (pumpe loggeverktøy og slanger)\nProsess assisterer med det praktiske rundt brønnen.\nMekanisk stiller med boroskop hvis det er tilkomst til ringrom D\nLab analyserer væsken hvis mulig (Olje vann baseolje)\n\n\nKopiert mail fra Einar Veim\nJeg har funnet en pumpe som leverer ca 23 liter i minuttet. Pumpen kan\nsuge rett fra ett fat eller lignende, uten trykk inn på pumpen.\nDet vil si at vi kan fylle ett fat med vann og suge fra det, så får vi\nen viss volum kontroll på hvor mye vi pumper.\nJeg foreslår da at vi forandrer prosedyren som følger:\n·,,Suge ut vann fra D-annulus.\n·,,Pumpe opp trykk i C-annulus\n·,,Inspisere rundt connection mellom 18 ¾" casing og wellhead med\nboroscope for å se etter lekkasje.\n·,,Fylle opp D-annulus og måle lekkasje rate ved hjelp av å måle volum\nsom renner over på D-annulus.\n·,,Blø av test trykk på C-annulus.\n·,,Finne topp av cement ved hjelp av lodd og fiskesen.\n Ved hjelp av denne metoden skulle vel vi få den mest nøyaktige måling\nav lekkasje rate.\n\n\n\nkopi av testprogram\nObjektiv: Identifisere mulig lekkasjepunkt i øvre del av 18 5/8" casing\n1. Drener ut væske fra D-ringrom slik at det er ca 1,5 til 2 meter ned\ntil væskespeil. Ta væskeprøve.\n2. Noter ned nøyaktig hvor mange cm det er ned til væskespeilet: ___cm\n3. Noter ned trykket på C-ringrom: ____ bar\n4. Trykk opp C-ringrom med vann til 15 bar.  Noter ned hvor mange liter\nsom ble brukt for å trykke opp: _____ liter (Hvis mulig)\n5. Følg med på trykkutviklingen og væskespeilet i D-ringrom. Noter ned\ntrykk og væskenivå ihht  tabell. Ikke avslutt test før stabilt trykk. Gå\ninn med boroskop i alle fire porter (Se bilde egen slide) og prøv å\nidentifisere eventuell lekkasje i øvre 18 5/8" kobling. (Mulig væske som\nrenner)\nHvis nivået i D-ringrom stiger slik at det vil renne over må væske suges\nut. Da må det noteres ned hvor mange cm det er rett før og rett etter\ndrenering.\n 6. Gå inn i alle fire porter med fiskesen m/lodd for å prøve å\nidentifisere topp 18 5/8" sement. Max ca 200 m.\n\nSjekkliste utstyr\n\n1.,,Pumpe til å trykke opp C-ringrom: Cameron\n2.,, Slanger til pumpe for å trykke opp C-ringrom: Cameron\n3.,, Testflens med kobling for test av C-ringrom, testkart Nvision:\nCameron\n4.,, Vakuumsuger for tømming D-ringrom: Drift\n5.,, Slanger for tømming av D-ringrom: Cameron\n6.     Væskeprøve: Drift\n7.     Utstyr for måling av væskenivå i D-ringrom: Drift/Cameron\n8.     Boroskop: Drift\n9.     Fiskesen med lodd ( ca 200 meter): Cameron\n','E','','','','','','','OR000024564629',NULL,'','','E','10007454','O053C','U','Unprior <= 12 months','T.O053C.DG.S05C5','T.O053C.DG.S05C5','','','','','','1766','','','','','1766','1766-S1305','0.000','POMPRO','DV Prosess','','','1766',' ',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
