es en liten korreksjon på tekst i det nye infovinduet for\nEltrip2: "<H>«…Blokkering av NTB-79-0100, under "Virkning", vil kunne\nhindre NAS 1.0 i å aktivere El.tripp 2»</>\n\n<H>Her skal "kunne" endres til "kun":</>\n\n<H>«…Blokkering av NTB-79-0100, under "Virkning", vil kun hindre NAS 1.0\n i å aktivere El.tripp 2»</>\n\n*******************************************************************\n02.10.2018, Morten Tellevik\nSatt i JTES, kontrollrommet har sett over endringene.\n*******************************************************************\nBeskrevet endring er OK for implementering i SAS-systemet på Oseberg\nSør.\nKan utføres direkte offshore.\n\nSetter WO i RDEX.\n01.10.2018\nJank\n*******************************************************************\n08.08.2018, Mona Holme Gundersen\nLagt inn HMI bilder_før_etter endring, og kopi av alarmlisten etter\ntest.\n\n31.07.2018, Mona Holme Gundersen\nLagt inn nye operasjoner, og objects som manglet.\nI tillegg vedlegg for CFC før_etter endring, Ladeliste IAT, OPIS liste,\nAlarmliste, og prosedyre(offshore).\nSatt status JDES.\n\n**********************************************************************\n24.04.2018, Jarle Gulbrandsen\nSiemens har estimert jobben til 30 timer på land og 12 timer offshore.\nGitt klarsignal til at jobben kan påbegynnes og releaset PM06.\n***********************************************************************\n\n04.04.2018, Jarle Gulbrandsen\nBedt Siemens estimere jobben, via henvendelse i SMT.\n********************************************************\n\n<H>I El.trip-bilde 70.38.02 må det gjøres noen endringer gjeldende </>\n<H>El.trip 2:</>\n\n<H>- Symbol for 1.4.MFB.4T03 endres ved at mulighet for blokkering og\nundertrykking fjernes fra faceplate (OS_EN endres fra 12 til 0).</>\n<H>MFB 4T03 viser i realiteten kun statusen "El.trip 2 bekreftet\nutløst".</>\n<H>Tagnr. på MFB 4T03 endres fra HS  -70-0201A til HB  -70-0202A.</>\n\n<H>- Det lages et infobilde for El.trip 2. Tekst i infobildet (med mal\nfra infobilder for El.trip 1 og 3A/B):</>\n\n<H>"El.tripp 2</>\n<H>Beskrivelse:</>\n<H>Elektrisk isolering av Non-Ex utstyr og stikkontakter i mekanisk\nventilerte områder i boremodul.</>\n\n<H>El.tripp 2 blokkeres fra matrise, i felt helt til venstre. Blokkering\n vil hindre nedstengning i henhold til C<(>&<)>E: 11-3A-AK-I79-15101.</>\n\n<H>Blokkering av NTB-79-0100, under "Virkning", vil kun hindre NAS 1.0 i\n å aktivere El.tripp 2."</>\n\n\n<H>Det gjøres samtidig korreksjon av skrivefeil i infobilde P01_70_38_02\n (El.tripp 1), ved at "omeråde" endres til "område".</>\n\n<H>I node F04 gjøres følgende endringer:</>\n<H>- På MFB 4T03 endres tagnr. fra HS  -70-0201A til HB  -70-0202A.</>\n<H>Beskrivelse (PSRV) endres fra "EL.TRIPP 2" til "EL.TR.2 BEKR.UTL"</>\n\n<H>- DSB 4S02 tildeles tagnr. HS  -70-5002</>\n\n<H>- Infotekst for DPBE 1044 BI08 korrigeres fra "EH-84-0030ZB4_OV" til\n"EH-82-0030ZB4_OV"</>\n\n- Det legges inn en kommentarblokk ved DPBE 1044, med tekst:\n"BI08, 09 og 10 aktiveres fra matrise, blokkering av El.tripp 2, HS\n -70-0202K"\n\nOpis\nHS  -70-0201A, 1.4.MFB.4T03 settes historisk.\nErstattes av HB  -70-0202A, 1.4.MFB.4T03, <H>"El.tripp 2 bekreftet\nutløst"</>\n\n<H>HS  -70-5002 opprettes som nytt tag, mot 1.4.DSB.4S02. Beskrivelse:\n"El.tripp 2"</>\n','E','','','','','','','OR000024392458',NULL,'','','E','10007454','O053C','L','Low <= 6 months','T.O053C.GA.S1001','T.O053C.GA.S1001','','44440212','','','','1766','C12','','UTILITIES AREA CELLAR DECK LEVEL 2','','1766','1766-IO-69-0017','46000.000','IMOAUTSA','FFO Automasjon SAS','','','1766',' ',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
