gt i hylle\n4 på smådelelager til ABB kommer ut igjen.// AMG\n\n19.08.18: Denne jobben kunne ikke gjøres i sin helhet, da deler ble\nsendt til Oseberg Øst i stedet for til Oseberg Sør. ABB ble sendt i land\nuten å få gjort ferdig jobben (deler av sjekken er gjort).\nNytt utkall av leverandør gjøres nå samtidig med WO: 24435478 HKB. //AMG\n\n11.7.18 Req opprettet mot ABB, de kontakter FA for avklaring rundt dato\n, men i utgangspunktet 3.8.\nLeverandør skjema må FA offshore hjelpe til med å lage // sk\n\n05.07.2018:  Må planlegges med leverandørutkall.\n\n15.06.2018 // MRRøttingen\nDet har blitt diskutert at når vi ikke har IS-limitor installert\nskal begge hovedkraft være tilgjengelig/i drift. Dette må ses ifm denne\njobben og når vi skal installere IS-limitorer.\n______________________\n\nRecommendation for the next service intervention\nThe next check will be due after 8’000 operating hours or one year of\noperation.\nTo ensure a safe and reliable operation of the unit, we strongly\nrecommend to order a qualified RENK-MAAG Service Engineer for the\nupcoming Inspection to perform a respective check. According to our\nmaintenance manual, a 8’000 operating hours check should then be\nperformed.\n\n\nFV FOR GASS TURBIN , HOVEDKRAFT GEN A','E','','','','','','','OR000024327346',NULL,'','','T','10007454','O053C',' ','','T.O053C.GA.S1001','T.O053C.GA.S1001','4','','','HKASTOPP','Samling av jobber mot Hka stopp','1766','C20','','UTILITIES AREA MAIN DECK GENERAL','','1766','1766-S8001','0.000','POMELE','D&V Elektro','10207409','1191249','1766',' ',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
