\neksosstruktur, og inspektør fra namtvedt i 10 dager under påføring av\nwrappingen. det planlegges at TT-laget bruker 10 dager på wrappingen og\n4 dager på generell malingsutbedring. det er vanskelig å sette eksakt\nestimat på dette da det er mange faktorer som påvirker utfallet. vær,\nvarmeeksponering fra eksos i drift og tid mellom oppstart og nedstegning\nav HK A og B. Det planlegge med å benytte Wrapping for høyetemperaturer\nog med full styrke gjennoppretting av 11 punkt ref rapport i NOT. Det\nplanlegges å nålebanke,bristelblaster og sandblåse for siste ruhet og\nrenhet i stålet før wrapping. Stillas og tildekkeing pågår det oppgang\nfor og ikke lagt inn i AO pr nå. Vi jobber med å se på bruk av\nvakumblåsing, noe som vil redusere omfang tildekking til det minimale.\nbehov for tildekking vil være etter beste evne på arbeidspunktet og\ntildekke innsugg til HK under gjennomføringen til eksoskanalene. her kan\nskjerming med duk og viledon duk benyttes.\n\n09.07.18\n\nTØ\n\n\n03.07.2018\nJobb releaset etter avtale med Idar Sunde. I første omgang for å gå opp\njobben i felt for vurdering av stillas/tildekking. Estimat stammer fra\ntilsvarende jobb utført på Oseberg Øst, ref. Ao24381172. Jobb timesettes\nog vurderes i release på nytt. Antatt oppstart medio august 2018.\n\nPetter Monsvik\n\n02.07.2018 Petter Monsvik\nBer om at denne jobben estimeres/timesettes av Linjebygg ved at følgende\ngjøres:\n- Opprett operasjoner med timeestimat for alle aktiviteter som denne\njobben omfatter\n- Samlet kost/estimat legges inn i feltet «Costs» på headerdata.\n- Når dette er gjort settes «PlannerGrp» til SOP og jobb settes i\nstatus PRCO(dersom vi venter på matr/deler) eller RDEX dersom klar for\nutførelse.\n\n\n\n\n','E','','','','','','','OR000024473507',NULL,'','','E','00000000','O053C','U','Unprior <= 12 months','T.O053C.GA.S1001','T.O053C.GA.S1001','','45276919','','','','1766','T00','','TOPSIDES AREA GENERAL','','1766','1766-A 02T00','500000.000','C34SUR','Linjebygg ISO O