t. Er laget notifikasjon på\nå få installert permanent conductor stabilisering. Denne jobben med\nmidlertidig stabilisering var ment å gjøre før vinterstormene slo inn.\nPlanlegges installering av permanent conductor stabilisering iløpet av\nsommer 2018<(>,<)> Ref M6-44975908 / Anders Erstad\n\n15.02.2017:Costestimeres til kr 85000 som innkuderer klatrere,og nye\neike kiler. Hvis det skal utføres en større permanent jobb i\nmilionklassen bør det opprettes en ny jobb for å ivareta dette.\nCostestimatet forutsetter at denne utføres samtidig med et annet klatre\noppdrag.. Jobb klar for REL. //Jonny\n\n19.01.2017: Besluttet i GP møte å rekvirere inspeksjonspersonell\n(klatrere) for å sjekke om vi har skader/sprekker som må utbedres før\npermanent løsning med plass støpte foringer v/Oceaneering. Det\nrekvireres nye spissere og lengre kiler for midlertidig sikring der det\ner behov.  Utifra resultat av inspeksjon må kritikalitet/EXTR\nrevurderes. Permanent løsning er å støpe foringer må utføres i rolig\nsommer vær.Løsningsforslag; https://www.youtube.com/watch?v=tSQx2tri180\n  Oseberg Øst har utført en tilsvarende jobb med sine conductore med bra\nresultat//Jonny\n\n\n19.1.17 ref. ao 23731709 // sk\n\n','E','','','','','','','OR000023940975',NULL,'','','E','10007454','O053C','U','Unprior <= 12 months','T.O053C.GA.S1001','T.O053C.GA.S1001','','44681931','','KLATRERE','Samling av jobber mot klatrere','1766','','','','','1766','1766-S1301','85000.000','POMMEC','DV Mekanisk','','','1766','X',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
