n løsning enn fartshump..; Det er besluttet at vi\nforsøker å bore opp ytterligere sparkelist mot sør. Bores med hullbor av\nstørre size helt ned mot dørk, eller skjære ut firkant felter av\nsparkelist helt ned mot dørk. Dette for at brannfarlige kjemikaljer skal\nrenne på sjøen ved en utilsiktet lekkasje/hendelser. Sparkelist må/skal\nkunne holde eventuelt "brann" skum på plass. Mot øst er det en stor\nrenne som skal kunne ta av for eventuelle lekkaser og vann. Legger inn\n12 timer på jobben da planen er at det skal være nok tid til å utføre\ndette grundig og forhåpentligvis ein gang for alltid.-  //Jonny\n\n','E','','','','','','','OR000024275237',NULL,'','','E','10007454','O053C','U','Unprior <= 12 months','T.O053C.GA.S1001','T.O053C.GA.S1001','','45015908','','','','1766','P11','','PROCESS AREA CELLAR DECK LEVEL 1','','1766','1766-P11','14160.000','POMMEC','DV Mekanisk','','','1766','X',' ',' ',' ',' ',' ','','','',NULL,' ',NULL,' ',' ',' ',' ',' ',' ','');
